"use strict";

function maximumRemovals(s, p, removable) {
    function check(k) {
        let i = 0, j = 0;
        let ids = new Set(removable.slice(0, k));
        while (i < m && j < n) {
            if (!ids.has(i) && s[i] === p[j]) {
                j += 1;
            }
            i += 1;
        }
        return j === n;
    }
    let m = s.length, n = p.length;
    let left = 0, right = removable.length;
    while (left < right) {
        let mid = (left + right + 1) >> 1;
        if (check(mid)) {
            left = mid;
        } else {
            right = mid - 1;
        }
    }
    return left;
}
